import React, {Component} from 'react';
import Navigation from "./Navigation";

class Header extends Component {
    render() {
        return (
            <div className={'header row'}>
                <div className={'col-md-6'}>
                    <Navigation/>
                </div>
            </div>
        );

    }
}

export default Header;
